import React, { useState, useEffect } from 'react';
import './Books.css';

const Books = () => {
  // Sample book data for demonstration
  const sampleBooks = [
    {
      id: 1,
      title: 'Book 1',
      author: 'Author 1',
      genre: 'Fiction',
    },
    {
      id: 2,
      title: 'Book 2',
      author: 'Author 2',
      genre: 'Non-fiction',
    },
    // Add more book objects as needed
  ];

  // You can fetch the book data from an API or database using useEffect and useState

  return (
    <div>
      <h1>Books</h1>
      <div className="book-list">
        {sampleBooks.map((book) => (
          <div key={book.id} className="book-card">
            <h2>{book.title}</h2>
            <p>Author: {book.author}</p>
            <p>Genre: {book.genre}</p>
          </div>
        ))}
      </div>
    </div>
  );
};

export default Books;
